var cookies = function()	{
	var $el = jQuery('#cookies');
	if(localStorage.cookies === undefined)	{
		$el.addClass('active');
		$el.find('.btn_c').click(function()	{
			try {
				localStorage.setItem('cookies', new Date());
				$el.removeClass('active');
			} catch(e) {
				$el.removeClass('active');
			}
		});
	}
	else	{
		$el.remove();
	}
};

