function createVimeoEmbed(url, container) {

    var section_id = 1;
    var vimeoURL = url;
    var protocol = vimeoURL.slice(0, 5);

    if (protocol == "https") {
        //then the video is served via https, doy
        var vimeoID = vimeoURL.substring(18);
    } else {
        protocol = "http";
        var vimeoID = vimeoURL.substring(17);
    }

    var vimeopreview = "<div class='vimeoFrame'><iframe id='player_" + section_id + "' class='video_container embed-responsive-item vimeoXtra' width='100%' height='535' src='" + protocol + "://player.vimeo.com/video/" + vimeoID + "?autoplay=1&player_id=player'  frameborder='0' webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe></div>";
    jQuery("." + container).prepend(vimeopreview);
    var $video_container = jQuery("." + container);

    var iframe = jQuery('#player_' + section_id);
    var player = new Vimeo.Player(iframe);

    player.on('play', function () {
        jQuery('#video_btn').hide();
        jQuery('.post_video .overlayvideo_thumbnail').hide();
    });
}

function createYouTubeEmbed(url, object, container) {
    var section_id = 1;
    var youtubeURL = url;
    if (youtubeURL.length > 28) {
        var uri = youtubeURL;
        var queryString = {};
        uri.replace(
                new RegExp("([^?=&]+)(=([^&]*))?", "g"),
                function ($0, $1, $2, $3) {
                    queryString[$1] = $3;
                }
        );
        var youtubeID = (queryString['v']);
    } else {
        var youtubeID = youtubeURL.substring(16);
    }
    var youtubepreview = "<div class='vimeoFrame'><iframe id='player_" + section_id + "' class='video_container embed-responsive-item' width='100%' height='535' src='https://www.youtube.com/embed/" + youtubeID + "?rel=0&controls=1&showinfo=0&modestbranding=1' frameborder='0' allowfullscreen allowfullscreen='true' webkitallowfullscreen='true' mozallowfullscreen='true'></iframe></div>";
    //jQuery("." + container).prepend(youtubepreview);
    object.parents('.post_video').find("." + container).prepend(youtubepreview);
}

