function create_slider_wrap_slider($el) {
    var rowSize = jQuery('.slider-wrap').attr('data-rowSize');
    jQuery('.slider_wrap').on('init', function () {
        jQuery(".slider-wrap.desktop .slick-current").prev().removeClass('nextslide').addClass('prevslide');
        jQuery(".slider-wrap.desktop .slick-current").next().removeClass('prevslide').addClass('nextslide');
    });

    $el = $el === undefined ? jQuery('.slider-wrap') : $el;

    $el.slick({
        dots: true,
        arrows: true,
        rows: rowSize,
        autoplay: false,
        nextArrow: '<div class="arrows next-arrow"><i class="material-icons">arrow_forward</i></div>',
        prevArrow: '<div class="arrows prev-arrow"><i class="material-icons">arrow_back</i></div>',
		touchThreshold: 100,
		responsive: [
            {
                breakpoint: 1380,
                settings: {
                    arrows: false
                }
            },
            {
                breakpoint: 1024,
                settings: {
                    /*rows: 2,*/
                    arrows: false
                }
            },
            {
                breakpoint: 992,
                settings: {
                    slidesToShow: 1,
                    //rows: 1,
                    arrows: false
                }
            }
        ]
    }).on('afterChange', function () {
        jQuery(".slider-wrap.desktop .slick-current").prev().removeClass('nextslide').addClass('prevslide');
        jQuery(".slider-wrap.desktop .slick-current").next().removeClass('prevslide').addClass('nextslide');
        jQuery(".slider-wrap.desktop .slick-current").removeClass('nextslide');
    });
}

